import {useEffect,useState} from "react";
import axios from "axios";

export function WatherAPIdata(){

  const [category, setCategory] =useState([]);
  const [product, setProduct]= useState([{id:0,category:'', title:'',discription:'',image:'',price:0,rating:{rate:0,count:0}}]);

   function LoadCategory() {
     axios.get(/*'https://fakestoreapi.com/products/categories'*/`https://api.jsonbin.io/v3/b/68f1a874d0ea881f40a737dd`)
     .then(response=>{
       // if you want to add any now elemrnt
      response.data.unshift('all');
      setCategory(response.data);
     })
    
     }

     function LoadProduct(url) {
      axios.get(url).then(response=>{
        //setProduct(response.data);
        setProduct(response.data.record);
      })
     }
   

     function HendalCatogryChange(e){
      const optionval ="{e.target.value}";

      axios.get(`https://api.jsonbin.io/v3/b/68f196a6d0ea881f40a7276c`)
     .then(response=>{
       // if you want to add any now elemrnt
      
      
     })

      //LoadProduct(`https://fakestoreapi.com/products/categories/${e.target.value}`);

     }

  useEffect(() =>{
      LoadCategory();
     //LoadProduct('https://fakestoreapi.com/products');
    LoadProduct(`https://api.jsonbin.io/v3/b/68f196a6d0ea881f40a7276c`); // my api 
  },[])


  return(
    <div className="container-fluid">
      <header className="d-flex text-white justify-content-between p-2 bg-dark">
       <div>
        <span className="h4">Ecomersh Web API Data </span>
       </div>
       <div className="fs-5">
        <span className="px-2">Home</span>
        <span className="px-2">Electronic</span>
        <span className="px-2">Jewelery</span>
        <span className="px-2">Men's Fashion</span>
        <span className="px-2">Women's Fashion</span>
        </div>
         
         <div>
          <button className="bi bi-card4 btn btn-warning position-relative"><span className="badge rounded rounded-circle bg-danger position-absolute"></span>0</button>
         </div>

      </header>
      <section className="mt-4 row">
        <nev className="col-2">
            <label className="form-label fw-bold">Select Category</label>
            <div>
              <select className="form-select" onChange={HendalCatogryChange}>
                {
                category.map(catego=> <option key={catego} value={catego}> {catego.toUpperCase()} </option>)
                }

              </select>
            </div>
          </nev>

         <main className="col-10 d-flex flex-wrap overflow-auto" style={{height:'500px'}}>

         {
          product.map(prod=>
            <div className="card p-2 m-2" style={{width:'200px'}}>
              <img src={prod.image} className="card-img-top" height="120px"/>
              <div className="card-header" style={{height:'120px'}}>
                <div>
                  { prod.title }
                </div>
              </div>
             <div className="card-body">
                <dl>Price</dl>
                <dd>{prod.price}</dd>
                <dl>Reating</dl>
                <dd>
                  {
                    <span className="badge bg-success p-1 rounded">{prod.rating.rate}<span className="bi bi-star-fill"></span> <span className="text-secondary fw-bold">{prod.rating.count}</span></span>
                  }
                </dd>
             </div>
             <div className="card-footer">
              <button className="btn btn-warning bi bi-cart-dash w-100">Add to Card</button>
             </div>
            </div>
          )
         }

         </main>

        </section>

    </div>
  )
}
